import react from 'react';
import App from './App';
import App1 from './App1';
import { Switch, Route } from 'react-router';

const Mainapp = () =>{

    return(
        <>
        
        <Switch>
<Route  exact path= "/app" component = {App}/>
<Route exact path = "/app1" component={App1}/>
</Switch>
  </>
    );
    }
    export default Mainapp;
